import React, { useState, useEffect } from "react";
import { useLocation, useNavigate } from "react-router-dom";
import { updateOrder } from "../API/OrderApi";

const UpdateOrder = () => {
  const { state } = useLocation(); // Get the order details from state
  const navigate = useNavigate(); // Initialize navigate
  const [orderDetails, setOrderDetails] = useState(state ? state.orderDetails : {});
  const [error, setError] = useState(null);

  useEffect(() => {
    if (!state || !state.orderDetails) {
      navigate("/");
    }
  }, [state, navigate]);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setOrderDetails((prevState) => ({
      ...prevState,
      [name]: value,
      UserId: 'admin',
    }));
  };
console.log(orderDetails);
  const handleUpdate = async () => {
    try {
      setError(null);
      const response = await updateOrder(orderDetails); // Call updateOrder API

      if (response && response.success) {
        window.alert(`Order No ${orderDetails.OrderNo} has been updated successfully.`);
        navigate("/"); // Navigate back to the home page after successful update
      } else {
        setError("Failed to update the order");
      }
    } catch (err) {
      setError("An error occurred while updating the order");
      console.error(err);
    }
  };

  return (
    <div>
      <h2>Update Order</h2>
      {error && <p style={{ color: "red" }}>{error}</p>}

      <div>
        <label>Order No</label>
        <input
          type="text"
          name="OrderNo"
          value={orderDetails.OrderNo}
          disabled
        />
      </div>

      <div>
        <label>Order Date</label>
        <input
          type="datetime-local"
          name="OrderDate"
          value={new Date(orderDetails.OrderDate).toISOString().slice(0, 16)}
          onChange={handleChange}
        />
      </div>

      <div>
        <label>Order Status</label>
        <input
          type="text"
          name="OrderStatus"
          value={orderDetails.OrderStatus}
          onChange={handleChange}
        />
      </div>

      <div>
        <label>Client</label>
        <input
          type="text"
          name="Client"
          value={orderDetails.Client}
          onChange={handleChange}
        />
      </div>

      <div>
        <label>Article No</label>
        <input
          type="text"
          name="ArticleNo"
          value={orderDetails.ArticleNo}
          onChange={handleChange}
        />
      </div>

      <div>
        <label>Delivery Date</label>
        <input
          type="datetime-local"
          name="DelieveryDate"
          value={new Date(orderDetails.DelieveryDate).toISOString().slice(0, 16)}
          onChange={handleChange}
        />
      </div>

      <div>
        <label>Approved By</label>
        <input
          type="text"
          name="ApprovedBy"
          value={orderDetails.ApprovedBy}
          onChange={handleChange}
        />
      </div>

      <div>
        <label>Date</label>
        <input
          type="datetime-local"
          name="Date"
          value={new Date(orderDetails.Date).toISOString().slice(0, 16)}
          onChange={handleChange}
        />
      </div>

      <div>
        <label>User ID</label>
        <input
          type="text"
          name="UserId"
          value={orderDetails.UserId}
          onChange={handleChange}
        />
      </div>

      <button onClick={handleUpdate}>Update</button>
    </div>
  );
};

export default UpdateOrder;
